--------------------------------------------------------
--  View
--------------------------------------------------------

CREATE OR REPLACE VIEW INVENTORY_VIEW
                AS
  SELECT P.name AS product,
    L.name      AS location,
    I.available
  FROM INVENTORY I,
    PRODUCT P,
    LOCATION L
  WHERE p.id = I.product_id
  AND l.id   = I.location_id;

